import { slide as Menu } from "react-burger-menu";

export default props => {
  return (
    <Menu {...props}>
      <a href="#home" className="menu-item" >
        Home
      </a>
      <a href="#team" className="menu-item" >
    Team
        </a>
        <a href="#value" className="menu-item" >
        Value
        </a>
        <a href="achievement" className="menu-item" >

        </a>
   </Menu>
  );
};
